const dark =
  'data:image/png;base64,';

const light =
  'data:image/png;base64,';

export default ({ theme = 'auto', ...props }) => {
  let variant = theme;
  if (theme === 'auto') {
    if (window.matchMedia) {
      if (window.matchMedia('(prefers-color-scheme: dark)').matches) {
        variant = 'dark';
      } else {
        variant = 'light';
      }
    }
  }
  return (
    <img
      {...props}
      width="48"
      height="48"
      alt="Tokens"
      src={variant === 'dark' ? dark : light}
    />
  );
};
